import React from 'react'
import Profile from '../profile/profile';
import Jobs from "../jobs/jobs";
import {Grid} from "@mui/material";
import Skills from "../skills/skills";
import Language from "../language/language";

function Layout() {
    return (
        <div>
            <Profile/>
            <br/>
            <h2 style={{textAlign: "center", width: "100%" , color :"white"}}>
                RESUME
            </h2>
            <Grid container spacing={5} style={{padding: '40px 100px', color: 'white' , justifyContent:'center'}}>


                <Grid item xs={5}>
                    <Jobs
                        JobTitle={'Graphic Rivers'}
                        JobDuration={'2013 - 2017'}
                        JobDepartment={'Director Of Department'}
                        JobDescription={"Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit \n" +
                        "id est laborum. Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do iusmod \n" +
                        "incididunt ut labore et dolore magna aliqua."}
                        type={'job'}
                    />

                </Grid>
                <Grid item xs={5}>
                    <Skills SkillName={'test skill'} AbilityRate={70}/>
                </Grid>
            </Grid>
            <Grid container spacing={5} style={{padding: '40px 100px', color: 'white' , justifyContent:'center'}}>


                <Grid item xs={5}>
                    <Jobs
                        JobTitle={'Graphic Rivers'}
                        JobDuration={'2013 - 2017'}
                        JobDepartment={'Director Of Department'}
                        JobDescription={"Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit \n" +
                        "id est laborum. Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do iusmod \n" +
                        "incididunt ut labore et dolore magna aliqua."}
                        type={'project'}
                    />

                </Grid>
                <Grid item xs={5}>
                    <h3 style={{textAlign:'center'}}>
                        Language Skills
                    </h3>
                    <Language
                        name={'English'}
                        Speaking={4}
                        Listening={4}
                        Writing={4}
                        Reading={4}
                    />
                </Grid>
            </Grid>
        </div>
    )
}

export default Layout;
